  [],\n\t\"revision_timestamp\": \"2015-05-06T22:32:23.931188\",\n\t\"name\": \"small-probes-for-orbital-return-of-experiments-spore-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Analogous to the CubeSat standardization
  of micro-satellites, the SPORE flight system architecture will utilize a modular
  design approach to provide low-cost on-orbit operation and recovery of small payloads.
  \ The Phase 1 investigation will evaluate a scalable flight system architecture
  consisting of a service module for on-orbit operations and deorbit maneuvering,
  and an entry vehicle to perform entry, descent and landing (EDL).  The design space
  for the SPORE system architecture is shown in Figure 1.  Flight system designs capable
  of accommodating payload volumes ranging from 1-unit (1U) dimensions of 10x10x10
  cm to 4U dimensions of 20x20x20 cm will be investigated.  The proposed system will
  be capable of flight operations and return from low-Earth orbit (LEO) and geosynchronous
  transfer orbit (GTO).  The SPORE design can be launched as a primary or secondary
  payload into LEO or GTO, or it can be deployed from the International Space Station
  (ISS).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
